import React, { Component } from "react";

class Input extends Component {
  render () {
    return (<form className={this.props.sn} onSubmit={this.props.handleSubmit}>
        <h1>{this.props.sn}</h1>
        <input 
        onChange={this.props.handleChange}
        placeholder={this.props.p1}
        type="text"
        /><br />
        <input 
        onChange={this.props.handleChange}
        placeholder={this.props.p2}
        type="text"
        /><br />
        <input 
        onChange={this.props.handleChange}
        placeholder={this.props.p3}
        type="text"
        /><br />
        <input 
        onChange={this.props.handleChange}
        placeholder={this.props.p4}
        type="text"
        /><br />
        <button className={this.props.sn} >SUBMIT</button>
    </form>);
  }
}

export default Input;
